import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      data : []
    }
  }

  componentDidMount(){
      fetch('http://localhost:8080/data')
        .then(res => res.json())
        .then(json => {
            this.setState({
              data : json
            })
        });
  }

  render(){

    var {data} = this.state;
    return(
      <div className ="App">
        <ul>
          {data.map(d => (
            <li key={d.id}>
              {d.id} | {d.country} | {d.state} | {d.confirmed} | {d.recovered} | {d.death}
            </li>
          ))};
        </ul>
      </div>
    )
  }
}
export default App;
